import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import PaymentPage from './PaymentPage';

function App() {
  return (
    <BrowserRouter>
      <Routes>

        <Route path="/" element={<PaymentPage />} />
        Route
        {/* Other routes */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
